package org.company.esc.tugasakhir;public class Acara {    private String name;    private String from;    private String photo;    private String deskripsi;    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getFrom() {        return from;    }    public void setFrom(String from) {        this.from = from;    }    public String getPhoto() {        return photo;    }    public void setPhoto(String photo) {        this.photo = photo;    }    public String getDeskripsi() {        return deskripsi;    }    public void setDeskripsi(String deskripsi) {        this.deskripsi = deskripsi;    }}